INSERT INTO `discount_details` VALUES (14,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1727454629/LOGO_LA_CAMPANA_gjkdek.png','La Campana','• 15% de descuento válido en menú a precio regular para comer en restaurante y para llevar.  \n• Descuento aplica de lunes a domingo.  \n• El descuento no aplica por servicio delivery\n• No aplica en propina, promociones de temporada, porciones, campanazo o APP asociadas a Restaurantes La Campana, promo mi media campana (combo para dos), promo campa cheros (combo para 4), ni porciones, promociones desayunos 2x$7.50, ni promo tortas 2x$8 lunes y martes. ni con otras promociones o descuentos vigentes, promo tortas mes de septiembre, combo el rey, combo original, promo 1 y promo 2.\n• No aplica en días festivos, asueto o días que la marca lo mencioné en sucursales, por ejemplo: día de la madre, día del padre, fuleada de tacos, taco friday, etc\n• Cliente deberá solicitar el descuento al momento de pagar para aplicar a la promoción.\n• No se hará ninguna devolución o aplicación de descuento después de generada factura o ticket de compra sin excepciones. Sino mencionan la promoción al momento de pagar no aplicará por ningún motivo generada la factura o ticket de compra ya que nuestro sistema no posee política de devolución en promociones.\n',''),(15,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1727454629/LOGO_LOS_RANCHOS_mfwsgj.jpg','Los Ranchos','10% de descuento en menú de desayuno y menú a la carta en un monto máximo de compra de US$50.00.',''),(16,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1727454629/LOGO_PUYAS_f37xvd.jpg','Puyas Grill & Bar','10% de descuento en menú de desayuno y menú a la carta en un monto máximo de compra de US$50.00.',''),(17,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1730245112/Logo_Bi_gqtjfn.png','Body Impact','Plan B.I Plus US$35.00 en cualquier forma de pago.\n Membresía anual US$10.00 (precio normal US$40.00).\n Consulta nutricional US$10.00.\n No aplica para spinning.\n ',''),(18,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1749153281/LOGO-MEDICAL-CARE-group_anficb.png','Medical Care Group','15% de descuento en la compra de las siguientes líneas de producto: Medical Care, Medical Conforta y Orthopedic Pro, Fisio Care, Medical Confort, Medical Care (seguridad y salud ocupacional), Flexi Care, Student y Medical Rent.',''),(19,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1718830623/IMG_1637_iyemje.png','Creative Dental Care','\"15% de descuento en tratamientos dentales y productos, en efectivo.\n\"20% de descuento en limpieza dental.\n\"40% de descuento en odontología general el día del cumpleaños del afiliado.\n\"Es necesario hacer cita previa y entregar DUI junto al carnet\n','Creative Dental Care'),(20,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1749592023/dovb4hmk9eceitpygv4y.png','El Bendito','15% de descuento en menú a precio regular','El Bendito'),(21,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1749590672/krfedfyymavume42fqsi.jpg','The Moustache','o 20% de descuento en corte y/o afeitado. \no Aplica de domingo a viernes. \no No aplica sábado. \no Disponible en todas las sucursales. \no Requisito presentar carnet vigente y DUI.\n','The Moustache'),(22,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1749595843/vlr6clwsxrdyi9ch1kwz.jpg','Spoties','10% de descuento en bolsas de comida y latas de comida húmeda.\nVálido en ambas sucursales (Santa Elena y Santa Ana).\n','Spoties'),(26,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1753204652/Chery_uw80kj.png','CHERY','Precios especiales en modelos de la marca CHERY de Grupo Q. Modelos: \n\"ARRIZO 5 PRO: $2,000 de descuento \n\"TIGGO 2 PRO: $2,500 de descuento\n\"TIGGO 4 PRO: $3,000 de descuento \n\"TIGGO 7 PRO: $4,000 de descuento \n\"TIGGO 8 PRO (7 pasajeros): $5,000 de descuento \n\nDescuentos sobre precio público de cada modelo. No son acumulables con otras promociones.\n\n\nPolarizado 3M o V-KOOL + 1 mantenimiento GRATIS por su compra en cualquiera de nuestros modelos y 2 mantenimientos GRATIS por el modelo TIGGO 8 PRO.\n','CHERY'),(25,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1753204651/GoGreen_se1vct.jpg','Go Green',' 15% de descuento en menú regular al pagar en efectivo.\nRestricciones: Válido en menú principal, no válido con otra promoción o descuento, no válido en monto de propina, no válido en días feriados.\n 10% de descuento en menú regular al pagar en tarjeta.\nRestricciones: Válido en menú principal, no válido con otra promoción o descuento, no válido en monto de propina, no válido en días feriados.\n','Go Green'),(27,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1753204653/TheGreenHouse_i2qshz.jpg','The Green House',' 15% de descuento en menú regular al pagar en efectivo.\nRestricciones: Válido en menú principal, no válido con otra promoción o descuento, no válido en monto de propina, no válido en días feriados.\n 10% de descuento en menú regular al pagar en tarjeta.\nRestricciones: Válido en menú principal, no válido con otra promoción o descuento, no válido en monto de propina, no válido en días feriados.\n','The Green House'),(28,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1753204652/CrepeLovers_egu0vx.png','Crêpe Lovers','15% de descuento en menú regular al pagar en efectivo.\nRestricciones: Válido en menú principal, no válido con otra promoción o descuento, no válido en monto de propina, no válido en días feriados.\n 10% de descuento en menú regular al pagar en tarjeta.\nRestricciones: Válido en menú principal, no válido con otra promoción o descuento, no válido en monto de propina, no válido en días feriados.\n','Crêpe Lovers'),(29,'https://res.cloudinary.com/dubxbyjd3/image/upload/v1759786648/AMARELLO_yiwkhs.png','Amarello Beauty Salon','* 15% de descuento\n* Valido de lunes-jueves de 7:00 a.m. - 7:00 p.m.\n* Promoción no aplica para servicio de Balayache y compra de productos','Amarello Beauty Salon');
